userDefinedLinkHintCss:
#vomnibar {
  background-color: #373635;
  border: 2px solid #FFF0E7;
  border-radius: 0;
  box-shadow: none;
}
#vomnibar .vomnibarSearchArea {
  padding: 2px;
  border-bottom: 2px solid #FFF0E7;
  border-radius: 0;
}
#vomnibar input {
  border-radius: 0;
  background-color: #373635;
}
#vomnibar li.vomnibarSelected {
  background-color: #4C4946;
}
#vomnibar ul { background-color: #373635; margin: 1px 0; }
#vomnibar li { border-bottom: 2px solid #FFF0E7; }

* { font-family: Courier20, Courier13, Courier, monospace, sans-serif !important; }

div > .vimiumHintMarker {
  /* linkhint boxes */
  background: #373635;
  border: 2px solid #FFF0E7;
  border-radius: 0;
  box-shadow: none !important;
}

div > .vimiumHintMarker span {
/* linkhint text */
  color: #FFF0E7;
  font-weight: bold;
  font-size: 12px;
  text-shadow: none;
}

div > .vimiumHintMarker > .matchingCharacter {
  color: #BD7C4A;
}

#vomnibarInput { font: 20px Courier20 !important; }

div.vimiumHUD {
  background: #373635 !important;
  border: 1px solid #FFF0E7 !important;
  border-radius: 0 !important;
  box-shadow: none !important;
}

div.vimiumHUD .vimiumHUDSearchArea{
  border-radius: 0 !important;
  background: none !important;
}

div.vimiumHUD .vimiumHUDSearchAreaInner {
  color: #FFF0E7 !important;
}
